import React, {Component} from "react"



class Project extends Component {


    removeProject = () => {
        this.props.removeProject(this.props.id)
    }

    moveLeft = () => {
        console.log("move left")
        this.props.moveToInProgress(this.props.id)
        //next make project change collumn/parent
    }

    moveRight = () => {
        console.log("move right")
        //next make project change collumn/parent
    }



    render(){



        return (
            <div className="project">
                <h1>{this.props.name}</h1>

                <p>{this.props.description}</p>
                <div>
                    <button onClick={this.removeProject.bind(this)}>Delete</button>
                    {this.props.parentCollumn !== "done" && <button onClick={this.moveLeft.bind(this)}>{String.fromCharCode(8592)}</button>}
                    {this.props.parentCollumn !== "backlog" && <button onClick={this.moveRight}>{String.fromCharCode(8594)}</button>}

                </div>
            </div>
        );
    }
}

export default Project
